class Example extends Phaser.Scene {
    constructor() {
        super();
        this.move = 0;
    }
  preload() {
    let bgImageData =
      "data:image/png;base64,";

    let cashLogoDataImage =
      "data:image/png;base64,";

    let interface1Text =
      "data:image/png;base64,";

    let brushImageData =
      "data:image/png;base64,";

    let cardImageData =
      "data:image/png;base64,";

    let cardOverlayImageData =
      "data:image/png;base64,";

    let ticket1ImageData =
      "data:image/png;base64,";

    let ticket2ImageData =
      "data:image/png;base64,";

    let ticket3ImageData =
      "data:image/png;base64,";

    this.coinImageData =
      "data:image/png;base64,";
    this.load.setBaseURL("http://labs.phaser.io");

    this.textures.addBase64("bg", bgImageData);
    this.textures.addBase64("coin", this.coinImageData);
    this.textures.addBase64("interface1Text", interface1Text);
    this.textures.addBase64("cashLogo", cashLogoDataImage);
    this.textures.addBase64("card", cardImageData);
    this.textures.addBase64("brush", brushImageData);
    this.textures.addBase64("overlay", cardOverlayImageData);
    this.textures.addBase64("ticket1", ticket1ImageData);
    this.textures.addBase64("ticket2", ticket2ImageData);
    this.textures.addBase64("ticket3", ticket3ImageData);

    this.load.image("workaround", "assets/pics/turkey-1985086.jpg");
  }

  create() {
    let bgImage = this.add.image(
      this.cameras.main.width / 2,
      this.cameras.main.height / 2,
      "bg"
    );
    let scaleX = this.cameras.main.width / bgImage.width;
    let scaleY = this.cameras.main.height / bgImage.height;
    let scale = Math.max(scaleX, scaleY);
    bgImage.setScale(scale).setScrollFactor(0);

    let cashLogo = this.add.image(-30, 0, "cashLogo").setOrigin(0);
    cashLogo.displayWidth = 190;
    cashLogo.displayHeight = 150;

    let interface1Text = this.add.image(
      this.cameras.main.width / 2,
      this.cameras.main.height / 2 - 300,
      "interface1Text"
    );

    interface1Text.width = 720;
    interface1Text.height = 100;
    const { width: imageWidth, height: imageHeight } = interface1Text;

    let scaleText = 0.5;
    let direction = 1;

    this.tweens.addCounter({
      from: 1,
      to: 10,
      duration: 2000,
      ease: "Sine.easeInOut",
      repeat: -1,
      yoyo: true,
      onUpdate: (tween) => {
        scaleText = 1 + tween.getValue() / 100;
      },
    });

    this.time.addEvent({
      delay: 16.67,
      loop: true,
      callback: () => {
        interface1Text.setScale(scaleText);
        interface1Text.setPosition(
          this.cameras.main.width / 2,
          this.cameras.main.height / 2 - 220
        );
        interface1Text.setDisplaySize(
          imageWidth * scaleText,
          imageHeight * scaleText
        );

        if (scaleText >= 1.5 || scaleText <= 1) {
          direction *= -1;
        }

        scaleText += 0.01 * direction;
      },
    });

    let cardImage = this.add.image(
      this.cameras.main.width / 2,
      this.cameras.main.height / 2 + 30,
      "card"
    );

    cardImage.displayWidth = 710;
    cardImage.displayHeight = 765 / (1420 / 664);
    cardImage.setInteractive({ cursor: "coin, pointer" });

    this.ticket1Image = this.add.image(
      cardImage.displayWidth / 2 - 90,
      cardImage.displayHeight / 2 + 60,
      "ticket1"
    );
    this.ticket1Image.displayWidth = 160;
    this.ticket1Image.displayHeight = 120;

    let ticket2Image = this.add.image(
      cardImage.displayWidth / 2 + 155,
      cardImage.displayHeight / 2 + 70,
      "ticket2"
    );
    ticket2Image.displayWidth = 160;
    ticket2Image.displayHeight = 120;

    let ticket3Image = this.add.image(
      cardImage.displayWidth / 2 + 155,
      cardImage.displayHeight / 2 + 240,
      "ticket3"
    );
    ticket3Image.displayWidth = 160;
    ticket3Image.displayHeight = 120;

    this.rt = this.add.renderTexture(
      this.cameras.main.width / 2,
      this.cameras.main.height / 2 + 30,
      700,
      750 / (1420 / 664)
    );
    
    let cardOverlayImage = this.rt.draw("overlay", 4, 2);
    this.rt.on("pointermove", (pointer) => {
      this.game.canvas.style.cursor = `url(${this.coinImageData}), auto`;
    });

    let ticket1Win = false;
    this.ticket1XCenter = this.ticket1Image.x;
    let ticket1YCenter = this.ticket1Image.y;

    this.gameOver = false;

    let ticket2Win = false;
    let ticket2XCenter = ticket2Image.x;
    let ticket2YCenter = ticket2Image.y;

    let ticket3Win = false;
    let ticket3XCenter = ticket3Image.x;
    let ticket3YCenter = ticket3Image.y;
    let winingTickets = [];
    // // this.add.rectangle(ticket1XCenter, ticket1YCenter, 95, 50, 0x6666ff);
    // // this.add.rectangle(ticket2XCenter, ticket2YCenter, 95, 50, 0x6666ff);
    // // this.add.rectangle(ticket3XCenter, ticket3YCenter, 95, 50, 0x6666ff);
    const brush = this.make.image({ key: "brush" }, false).setScale(0.3);
    cardOverlayImage.setInteractive({
      cursor: "url(assets/input/cursors/pen.cur, pointer",
    });

    this.input.on(
      "pointermove",
      (pointer) => {
        if (pointer.isDown && this.gameOver === false) {
          if (
            Math.abs( this.ticket1XCenter - pointer.x) <= 95 &&
            Math.abs(ticket1YCenter - pointer.y) <= 50
          ) {
            winingTickets.push("ticket1");
          }
          if (
            Math.abs(ticket2XCenter - pointer.x) <= 95 &&
            Math.abs(ticket2YCenter - pointer.y) <= 50
          ) {
            winingTickets.push("ticket2");
          }
          if (
            Math.abs(ticket3XCenter - pointer.x) <= 95 &&
            Math.abs(ticket3YCenter - pointer.y) <= 50
          ) {
            winingTickets.push("ticket3");
          }

          ticket1Win = typeof winingTickets.find((elem) => elem === "ticket1");
          ticket2Win = typeof winingTickets.find((elem) => elem === "ticket2");
          ticket3Win = typeof winingTickets.find((elem) => elem === "ticket3");

          setTimeout(() => {
            if (
                ticket1Win === "string" &&
                ticket2Win === "string" &&
                ticket3Win === "string"
            ) {
                this.gameOver = true; 
                // this.time.desiredFps = 20;
                // this.time.slowMotion = 0.5;

                // this.time.slowMotion = 0.1;
                // while(rt.alpha > 0) {

                //     rt.alpha -= 0.03;
                // }
            }
          }, 1000);
          this.rt.erase(brush, pointer.x - 150, pointer.y - 130);
        }
      },
      this
    );

    this.input.on(
      "pointerdown",
      (pointer) => {
        if (this.gameOver === false) {
          if (
            Math.abs( this.ticket1XCenter - pointer.x + 10) <= 95 &&
            Math.abs(ticket1YCenter - pointer.y + 10) <= 50
          ) {
            winingTickets.push("ticket1");
          }
          if (
            Math.abs(ticket2XCenter - pointer.x + 10) <= 95 &&
            Math.abs(ticket2YCenter - pointer.y + 10) <= 50
          ) {
            winingTickets.push("ticket2");
          }
          if (
            Math.abs(ticket3XCenter - pointer.x + 10) <= 95 &&
            Math.abs(ticket3YCenter - pointer.y + 10) <= 50
          ) {
            winingTickets.push("ticket3");
          }
        }
        ticket1Win = typeof winingTickets.find((elem) => elem === "ticket1");
        ticket2Win = typeof winingTickets.find((elem) => elem === "ticket2");
        ticket3Win = typeof winingTickets.find((elem) => elem === "ticket3");
        setTimeout(() => {
          if (
            ticket1Win === "string" &&
            ticket2Win === "string" &&
            ticket3Win === "string"
          ) {
            this.gameOver = true;
          }
        }, 1000);

        this.rt.erase(brush, pointer.x - 150, pointer.y - 130);
      },
      this
    );
    

  }
   update() {
    if(this.gameOver === true) {
    this.rt.alpha -= 0.03;
    if (this.rt.alpha < 0) {
        this.rt.alpha = 0;
    }
    this.rt.alpha = this.rt.alpha;
    
    }
    this.ticket1Image.x = 400 + Math.sin(-this.move) * 200;
    this.ticket1Image.y = 300 + Math.cos(-this.move) * 200;
    this.move = 0.01;

  }
}

let config = {
  type: Phaser.CANVAS,
  parent: "phaser-example",
  scale: {
    mode: Phaser.Scale.FIT,
    parent: "phaser-example",
    autoCenter: Phaser.Scale.CENTER_BOTH,
    width: 1000,
    height: 600,
  },
  width: 1000,
  height: 600,
  scene: Example,
};
let game = new Phaser.Game(config);
